import React from "react";
import { Row, Col } from "antd";
import "antd/dist/antd.css";
import ClubCard from "./ClubCard";

const PopularList = () => {
	return (
		<Row gutter={24}>
			<Col span={6}>
				<ClubCard />
			</Col>
			<Col span={6}>
				<ClubCard />
			</Col>
			<Col span={6}>
				<ClubCard />
			</Col>
			<Col span={6}>
				<ClubCard />
			</Col>
		</Row>
	);
};

export default PopularList;
